sys_variable_value.value:
(function execute(inputs, outputs) {
  // Validate Project ID and Account ID

  var gutils = new GoogleIdentityAccessUtils();
  var message = gutils.validateTheInputs(inputs);
  if (!message == 'Ok') { 
     throw new Error(message); 
  } 

  var payload = {
    accountId: inputs.serviceAccountID,
    serviceAccount: {
     displayName: inputs.serviceAccount_displayname,
     description: inputs.serviceAccount_description
    }
  }

  outputs.payload = JSON.stringify(payload);

})(inputs, outputs);

