sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = JSON.parse(inputs.response_body);
  if(inputs.status_code == "200") {
  	outputs.status = "Success";
    outputs.name = responseBody.name;
    outputs.project_id = responseBody.projectId;
    outputs.unique_id = responseBody.uniqueId;
    outputs.email = responseBody.email;
    outputs.display_name = responseBody.displayName;
    outputs.etag = responseBody.etag;
    outputs.description = responseBody.description;
    outputs.oauth2_client_id = responseBody.oauth2ClientId;
    outputs.disabled = responseBody.disabled;


    outputs.service_account = responseBody;
    outputs.service_account.Name = responseBody.name;
    outputs.service_account.Project_ID = responseBody.projectId;
    outputs.service_account.Unique_ID = responseBody.uniqueId;
    outputs.service_account.Email = responseBody.email;
    outputs.service_account.Display_Name = responseBody.displayName;
    outputs.service_account.Etag = responseBody.etag;
    outputs.service_account.Description = responseBody.description;
    outputs.service_account.OAuth2_Client_ID = responseBody.oauth2ClientId;
    outputs.service_account.Disabled = responseBody.disabled;
  } else {
  	outputs.status = "Error";
    outputs.error_message = new GoogleIdentityAccessErrorHandler().handleError(responseBody.error); 
  }
})(inputs, outputs);

